(function () {
  var provEle = document.getElementById('dealerPro');
  var cityEle = document.getElementById('dealerCity');
  var dealerEle = document.getElementById('dealer');
  var cacheAreaDealer = [];

  dealAreaDealerList(dealerList); // 处理省市经销商数据

  provEle.innerHTML = '<option value="">请选择</option>';
  cityEle.innerHTML = '<option value="">请选择</option>';
  dealerEle.innerHTML = '<option value="">请选择</option>';
  initProv();

  // prov change
  provEle.addEventListener('change', function(){
    cityEle.innerHTML = '<option value="">请选择</option>';
    dealerEle.innerHTML = '<option value="">请选择</option>';
    var selectedProvId = this.value;
    selectedProvId && initCity(selectedProvId);
  },true);

  // city change
  cityEle.addEventListener('change', function(){
    dealerEle.innerHTML = '<option value="">请选择</option>';
    var selectedProvId = provEle.value;
    var selectedCityId = this.value;
    selectedCityId && initDeal(selectedProvId,selectedCityId);
  },true);


  // 处理省市经销商数据
  /*
  cacheAreaDealer = [{
    province: '',
    city: [{
      city: '',
      dealers: [{
        id: '',
        name: ''
      }]
    }]
    
  }]
  */
  function dealAreaDealerList(dealerList){
    var i=0,l=dealerList.length;
    for(;i<l;i+=1){
      var data = {
          province: dealerList[i].province,
          city: [{
            city: dealerList[i].city,
            dealers: [{
              id: dealerList[i].id,
              name: dealerList[i].dealername
            }]
          }]
      };
      var provPlgData = hasProv(dealerList[i],cacheAreaDealer);
      var cityPlgData = hasCity(dealerList[i],cacheAreaDealer);
      if(provPlgData.plg){
        if(cityPlgData.plg){
          cacheAreaDealer[provPlgData.index]['city'][cityPlgData.index]['dealers'].push({
              id: dealerList[i].id,
              name: dealerList[i].dealername
            })
        }else{
          cacheAreaDealer[provPlgData.index]['city'].push({
            city: dealerList[i].city,
            dealers: [{
              id: dealerList[i].id,
              name: dealerList[i].dealername
            }]
          })
        }
      }else{
        cacheAreaDealer.push(data);
      }
      
    }
  }

  function hasProv(data,arr){
    var plg = false;
    var index = -1;
    arr.some(function(item,i){
      if(item.province == data.province){
        plg = true;
        index = i;
        return true
      }
    })
    return {plg:plg,index:index}
  }

  function hasCity(data,arr){
    var plg = false;
    var pIndex = -1;
    arr.some(function(item,index,a){
      if(item.province == data.province){
        a[index]['city'].some(function(cItem,cIndex,ca){
          if(cItem.city==data.city){
            plg = true;
            pIndex = cIndex;
            return true
          }
        })
        return true
      }
    })
    return {plg:plg,index:pIndex}
  }


  function initProv(){
    var opStr = '<option value="">请选择</option>';
    cacheAreaDealer.forEach(function(item,index,arr){
      opStr += '<option value="'+item.province+'">'+item.province+'</option>';
    });
    provEle.innerHTML = opStr;
  }

  function initCity(pro){
    var opStr = '<option value="">请选择</option>';
    cacheAreaDealer.some(function(item,index,arr){
      if(item.province==pro){
        arr[index]['city'].forEach(function(cItem){
          opStr += '<option value="'+cItem.city+'">'+cItem.city+'</option>';
        })
        return true;
      }
    });
    cityEle.innerHTML = opStr;
  }

  function initDeal(prov,city){
    var opStr = '<option value="">请选择</option>';
    cacheAreaDealer.some(function(item,index,arr){
      if(item.province==prov){
        item.city.some(function(cItem,cIndex,cArr){
          if(cItem.city == city){
            cArr[cIndex]['dealers'].forEach(function(dItem){
              opStr += '<option value="'+dItem.id+'">'+dItem.name+'</option>';
            })
            return true;
          }
        })
        return true;
      }
    });
    dealerEle.innerHTML = opStr;
  }

})()

